// src/components/PersonalDetails.js
import React from 'react';
import { Paper, Typography } from '@mui/material';
import { styled } from '@mui/material/styles';

const PersonalDetails = ({ details }) => {
  return (
    <StyledPaper>
      <Typography variant="h6" sx={{ color: 'teal', fontWeight: 'bold' }}>Personal Details</Typography>
      <Typography>Name: {details.name}</Typography>
      <Typography>Age: {details.age}</Typography>
      <Typography>Grade: {details.grade}</Typography>
      <Typography>Email: {details.contact.email}</Typography>
      <Typography>Phone: {details.contact.phone}</Typography>
      <Typography>Address: {details.contact.address}</Typography>
    </StyledPaper>
  );
};

const StyledPaper = styled(Paper)({
  padding: '20px',
  backgroundColor: '#333',
  color: '#fff',
  borderRadius: '8px',
  boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
});

export default PersonalDetails;
